("malako59", "<:malako_59:1100128611559821413>", "https://cdn.discordapp.com/attachments/992385192931106846/1100127371094396968/5-9.png", "Malako 5-9", "GraphicsCard", 299, "Introducing the Malako 5, the ninth generation graphics card proudly crafted by the renowned Malako Industries. Though hailed as the modest workhorse of their esteemed lineup, this treasure bears a charm of its own. Equipped with a single, unhurried fan, the Malako 5 embraces a steady pace, faithfully supporting the arduous task of mining the coveted cryptocurrency known as MathCoin. While its performance may not astound the masses, this unassuming gem provides an affordable gateway into the world of crypto mining. Let the Malako 5 be your steadfast companion on the path of mathematical prosperity, faithfully crunching algorithms to unlock the digital fortunes that lie within the realm of MathCoin.", 0.0, 0.002),
