("malako209", "<:malako_209:1100128240414228491>", "https://cdn.discordapp.com/attachments/992385192931106846/1100127373317382154/20-9.png", "Malako 20-9", "GraphicsCard", 69420, "Introducing the revered Malako 20, the pinnacle of mining mastery in the realm of cryptocurrencies. This coveted 9th generation graphics card embodies unbridled power and breathtaking speed, unrivaled among all its predecessors. Equipped with a triad of precision-engineered fans, it effortlessly harnesses the winds of innovation to propel your mining endeavors to unprecedented heights. Prepare to witness the symphony of ultra-high performance as this formidable beast blazes through computations with an unruly fervor, ensuring optimal efficiency in your quest for digital wealth. However, such exceptional prowess comes at a price, for the Malako 20 resides in the realm of the elite, commanding a lofty position within the echelons of the market. Designed exclusively for the captivating world of MathCoin mining, the Malako 20 stands resolute, an embodiment of technological supremacy, ready to transform your mining endeavors into a dazzling symphony of mathematical triumph.", 0.0, 0.12),
("malako510", "<:malako_510:1100128237285277746>", "https://cdn.discordapp.com/attachments/992385192931106846/1100127290593120417/5-10.png", "Malako 5-10", "GraphicsCard", 799, "Introducing the renowned Malako 5 graphics card, hailing from the illustrious Malako Industries. This remarkable piece of mining technology marks the 10th generation in the Malako 5 series. While it may be deemed the slowest and most basic among its brethren, this unassuming workhorse carries an undeniable allure for cost-conscious miners. Equipped with a single fan that leisurely spins to cool its components, the Malako 5 embraces a deliberate pace, neither fast nor sluggish. Its performance, though modest, delivers a steady and reliable output for those venturing into the realm of cryptocurrency mining. Designed with affordability in mind, this wallet-friendly gem provides a gateway to the realm of MathCoin, the coveted digital currency at the heart of your financial aspirations. Embrace the simplicity and cost-effectiveness of the Malako 5 as you embark on your mining journey, sowing the seeds of digital wealth with each calculated computation.", 0.0, 0.004),
