("malako2010", "<:malako_2010:1100128233728507944>", "https://cdn.discordapp.com/attachments/992385192931106846/1100127292140818482/20-10.png", "Malako 20-10", "GraphicsCard", 114999, "Introducing the illustrious Malako 20, the crown jewel of mining supremacy. As the pinnacle of their 10th generation '20' model lineup, this exceptional graphics card harnesses unrivaled power to unlock the untapped potential of MathCoin, the digital realm's most sought-after cryptocurrency. With an unrelenting thirst for unparalleled performance, the Malako 20 blazes through computational challenges with astonishing velocity, propelled by the relentless might of its three fans. Prepare to witness a symphony of sheer processing prowess as this beastly powerhouse surges through complex algorithms, effortlessly mining MathCoin at an unprecedented pace. However, be prepared to reach into the upper echelons of your treasure troves, for the Malako 20 commands a price commensurate with its uncompromising excellence. Brace yourself for a remarkable journey into the heart of cryptographic mastery with the legendary Malako 20, where fortune favors the daring miners in their quest for the bounties of MathCoin.", 0.0, 0.25),
("malako511", "<:malako_511:1100128230285004880>", "https://cdn.discordapp.com/attachments/992385192931106846/1100127095788666960/5-11.png", "Malako 5-11", "GraphicsCard", 1799, "Introducing the Malako Industries graphics card, hailed as the 11th generation of their renowned '5' model. While it may not possess the lightning speed or extravagant features of its siblings, this humble workhorse offers a cost-effective solution for mining the coveted cryptocurrency known as MathCoin. Equipped with a single fan that spins at a leisurely pace, this graphics card prioritizes reliability over blistering performance. Though its output may be considered mediocre, it faithfully carries out its duty, tirelessly crunching complex mathematical algorithms to unearth precious MathCoins. If you seek a budget-friendly option to fuel your cryptocurrency mining aspirations, look no further than the Malako 5 graphics cardâ€”a steadfast companion on your mathematical odyssey.", 0.0, 0.008),
