("malako1511", "<:malako_1511:1100128226174570527>", "https://cdn.discordapp.com/attachments/992385192931106846/1100127096803696720/15-11.png", "Malako 15-11", "GraphicsCard", 44999, "Introducing the Malako Industries' renowned '15' graphics card, now in its 11th generation. Engineered with utmost precision and unwavering dedication, this mining marvel stands as a testament to Malako's relentless pursuit of computational excellence. Equipped with three formidable fans, the Malako 15 ensures optimal cooling to harness its prodigious power efficiently. While it may not claim the title of the fastest graphics card in their illustrious lineup, its formidable velocity propels it into the upper echelons of mining prowess. Experience unrivaled performance as you delve into the realm of cryptocurrency mining, where the Malako 15 effortlessly extracts the digital gold known as MathCoin. Despite its extraordinary capabilities, this gem of technological ingenuity lies within the confines of a higher price class, a worthy investment for those who seek the pinnacle of mining potential. Unleash the extraordinary might of the Malako 15 and embark on a journey where computational supremacy meets the limitless possibilities of MathCoin mining.", 0.0, 0.09),
("malako2011", "<:malako_2011:1100128224245198921>", "https://cdn.discordapp.com/attachments/992385192931106846/1100127097382510653/20-11.png", "Malako 20-11", "GraphicsCard", 199999, "Introducing the Malako 20, an extraordinary graphics card designed explicitly for the exhilarating realm of cryptocurrency mining. This remarkable marvel marks the 11th generation of Malako's revered '20' series, standing as the pinnacle of their engineering prowess. With a triad of whispering fans, this technological powerhouse ensures unparalleled cooling efficiency while seamlessly harnessing its mind-bending speed. Prepare to be astounded as the Malako 20 propels you into a realm of unfathomable performance, delivering blistering speeds and unrivaled computational power. Designed exclusively for the captivating world of MathCoin mining, this cutting-edge masterpiece spurs your journey towards amassing virtual fortunes. Yet, such an unparalleled piece of technological mastery comes at a price, nestled within the upper echelons of the market's exalted realm. Elevate your mining ambitions to unprecedented heights with the legendary Malako 20, transcending boundaries to unlock the infinite potential of the MathCoin universe.", 0.0, 0.5),
